* {
  box-sizing: border-box;
}

body,
html {
  font-size: 18px;
  background: $color1;
  font-family: "Roboto Condensed", sans-serif;
  height: 100%;
}

.primary-btn {
  text-decoration: none;
  background: $color1;
  -webkit-border-radius: 30px;
  -moz-border-radius: 30px;
  border-radius: 30px;
  text-align: center;
  color: $color3;
  padding: 15px 30px;
  display: inline-block;
  text-transform: uppercase;
  letter-spacing: 3px;

  transition: #483b59;

  &:hover {
    border-color: $color1;
    color: #483b59;
    background: white;
  }
}

.ghost-btn {
  text-decoration: none;
  border: 4px solid #d9435f;
  -webkit-border-radius: 30px;
  -moz-border-radius: 30px;
  border-radius: 30px;
  text-align: center;
  color: $color1;
  padding: 12px 27px;
  display: inline-block;
  text-transform: uppercase;
  letter-spacing: 3px;
  transition: all 0.3s ease-in-out;

  &:hover {
    border-color: #202026;
    color: $color1;
    background: #483b59;
  }
}

.primary-btn,
.ghost-btn {
  margin-right: 15px;
  margin-bottom: 20px;
}

.hamburger-icon {
  position: fixed;
  right: 56px;
  top: 0px;
  padding: 20px;

  .fa {
    font-size: 2rem;
    color: $color2;
  }
}

.overlay {
  height: 100%;
  width: 0;
  position: fixed;
  z-index: 1;
  top: 0;
  left: 0;
  background-color: rgb(0, 0, 0);
  background-color: rgba(0, 0, 0, 0.9);
  overflow-x: hidden;
  transition: 0.5s;
}

.overlay-content {
  position: relative;
  top: 25%;
  width: 100%;
  text-align: center;
  margin-top: 30px;
}

.overlay a {
  padding: 8px;
  text-decoration: none;
  font-size: 36px;
  color: #818181;
  display: block;
  transition: 0.3s;
}

.overlay a:hover,
.overlay a:focus {
  color: #f1f1f1;
}

.overlay .closebtn {
  position: absolute;
  top: 20px;
  right: 45px;
  font-size: 60px;
}

@media screen and (max-height: 450px) {
  .overlay a {
    font-size: 20px;
  }
  .overlay .closebtn {
    font-size: 40px;
    top: 15px;
    right: 35px;
  }
}

.scroll-section {
  height: 100vh;
  overflow-y: scroll;
  overflow-x: hidden;
  padding: 56px;
}

